g2:c.PROCEDURE.g2:a.TEXT:
upp-create-new-workspace (sourceWS: class kb-workspace, W: class ui-client-item)
newWS: class kb-workspace;
begin
    create a kb-workspace newWS;
    conclude that the module-assignment of newWS = the containing-module of sourceWS;
    conclude that the background-color of newWS = the background-color of sourceWS;
    conclude that the foreground-color of newWS = the foreground-color of sourceWS;
    conclude that the workspace-margin of newWS = the workspace-margin of sourceWS;
    if (the frame-style of sourceWS exists) then
        conclude that the frame-style of newWS = the frame-style of sourceWS;
    show newWS on W;
    make newWS permanent;
end
